import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import download from '../../../img/download.png';

const OwnerItem = ({ profile: { _id, name, email, cellPhone, address } }) => {
  return (
    <div className='profile bg-light'>
      <img src={download} alt='' className='round-img' />
      <div>
        <h2>{type}</h2>
        <p>
          {manufacturer}
          {model && <span>{model}</span>}{' '}
        </p>
        <p>{transmission}</p>
        <Link to={`/VehicleById/${_id}`} className='btn btn-primary'>
          View Vehicle
        </Link>
      </div>
      <ul>
        <li className='text-primary'>
          <i className='fas fa-address-book'></i>{' '}
          {avail && <span>{'Availaibility'}</span>}{' '}
        </li>
        <li className='text-primary'>
          <i className='fas fa-check'></i> {avail && <span>{avail}</span>}{' '}
        </li>
      </ul>
    </div>
  );
};

OwnerItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default OwnerItem;
